column4:
Khóa luận gồm 3 chương. Chương I: Những vấn đề lý luận cơ bản về tổ chức công tác kế toán doanh thu, chi phí và xác định kết quả kinh doanh trong doanh nghiệp; 
Chương II: Thực trạng tổ chức công tác hạch toán kế toán doanh thu, chi phí và xác định kết quả kinh doanh tại Công ty TNHH Hương liệu Thực phẩm Việt Nam; 
Chương III: Một số giải pháp nhằm hoàn thiện tổ chức công tác kế toán doanh thu, chi phí và xác định kết quả kinh doanh tại Công ty TNHH Hương liệu Thực phẩm Việt Nam.
